import React, { useState } from 'react';
import './App.css';

function App() {
  const [tagId, setTagId] = useState('');
  const [dogData, setDogData] = useState(null);
  const [location, setLocation] = useState('');
  const [hospitalData, setHospitalData] = useState(null);

  // State for the Report Form
  const [sightingLocation, setSightingLocation] = useState('');

  // Function to get GPS location (WhatsApp style)
  const shareLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition((position) => {
        const { latitude, longitude } = position.coords;
        // Creates a Google Maps link just like WhatsApp
        setSightingLocation(`https://www.google.com/maps?q=${latitude},${longitude}`);
      }, () => {
        alert("Unable to retrieve location. Please enter manually.");
      });
    } else {
      alert("Geolocation is not supported by your browser.");
    }
  };

  const handleDogSearch = () => {
    const mockDogs = [{ DogID: "RED108", TagNumber: "108", Status: "VACCINATED", Date: "01-02-2026" }];
    setDogData(mockDogs.find(d => d.DogID === tagId.toUpperCase()));
  };

  return (
    <div className="App">
      <header className="emergency-header">
        <h1>RabiesAware Dashboard</h1>
        <div className="emergency-actions">
          <button className="btn-emergency">üìû CALL 112</button>
          <button className="btn-firstaid">ü©π FIRST AID</button>
        </div>
      </header>

      <main className="dashboard-layout">
        {/* LEFT: Search Tools */}
        <div className="left-section">
          <div className="card">
            <h2>üîç Verify Vaccination Tag</h2>
            <div className="search-row">
              <input type="text" placeholder="Tag ID..." value={tagId} onChange={(e) => setTagId(e.target.value)} />
              <button onClick={handleDogSearch}>VERIFY</button>
            </div>
            {dogData && <div className="result-info">Status: {dogData.Status}</div>}
          </div>

          <div className="card">
            <h2>üè• Nearby Medical Help</h2>
            <div className="search-row">
              <input type="text" placeholder="Enter City..." value={location} onChange={(e) => setLocation(e.target.value)} />
              <button onClick={() => setHospitalData({name: "City Medical Center"})}>SEARCH</button>
            </div>
          </div>
        </div>

        {/* RIGHT: ABC Center Report */}
        <div className="right-section">
          <div className="report-card">
            <h2>üì¢ Report Untagged Dog</h2>
            <p>Help ABC Center locate unvaccinated dogs.</p>

            <button className="btn-location" onClick={shareLocation}>
              üìç Share Current Location
            </button>

            <div className="divider">OR</div>

            <input 
              type="text" 
              placeholder="Enter Manual Location..." 
              value={sightingLocation}
              onChange={(e) => setSightingLocation(e.target.value)}
            />
            <textarea placeholder="Dog description (color, size)..." rows="3" />
            <button className="btn-report">SUBMIT TO ABC CENTER</button>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
